import React from "react";
import Form from "./Form";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.onClick = this.onClick.bind(this);
  }

  state = {
    containerSize: "100%",
    showQuery: false
  };

  onClick(e) {
    e.preventDefault();
    this.setState({ containerSize: "200%" });
  }

  render() {
    const { containerSize, showQuery } = this.state;
    return (
      <div className="container" style={{ height: containerSize }}>
        <div className="logo">
          <div className="ui header">Stalk</div>
          <i className="low vision icon"></i>
          <div className="ui header">Your Prof</div>
        </div>
        <Form onClick={this.onClick}></Form>
      </div>
    );
  }
}
export default App;
